import React from "react";
import "./style.css";

function BandcampCard(props){
    return(
        <div id="BandcampCard"> 
            <iframe src="https://bandcamp.com/EmbeddedPlayer/album=3091619907/size=large/bgcol=ffffff/linkcol=0687f5/tracklist=false/artwork=small/transparent=true/" seamless><a href="https://watershedgroup.bandcamp.com/album/watershed-trek-pacific-nw-january-2018">watershed trek (pacific nw january 2018) by watershed group</a></iframe>
        </div>
    )
}

export default BandcampCard;
